import React from "react";
import Navbar from "../Components/Navbar";
import Carousel from "../Components/Carousel";
import Collect from "../Components/Collect";
import Swiss from "../Components/Swiss";

const Home = () => {
  return (
    <>
      <Navbar />
      <Carousel />
      <Collect />
      <Swiss />
    </>
  );
};

export default Home;
